import { createElement } from 'react';
import { ERROR_MESSAGES } from './constants';
const ModalProvider = ({ children, value = [] }) => {
    if (!value.length)
        console.error(ERROR_MESSAGES.MODAL_PROVIDER_EMPTY_VALUE);
    return value.reduce((acc, curr) => createElement(curr, null, acc), children);
};
export default ModalProvider;
